import React from 'react';

import {IonButton} from '@ionic/react'
import './LoginModal.scss';

const LoginModal: React.FC<{
    onDismiss: () => void;
  }> = ({ onDismiss }) => (
    <div>
      <IonButton expand="block" onClick={() => onDismiss()}>
        Close
      </IonButton>
    </div>
  );



export default LoginModal;
